import React from 'react'

function Recipe(props) {
    return (
        <div>
            <h1>{props.title}</h1>
            <img alt="pic" src={props.image}></img>
            <p>Calories: {props.calories}</p>
            props.ingredients.
        </div>
    )
}


export default Recipe;
